import React from 'react'
import RegistrationInfo from '../components/RegistrationInfo'

function RegistrationPage(){
    return(
        <>
            <h2>Register to Trivia</h2>
            <p>You are now registered for Trivia</p>
            <RegistrationInfo/>
        </>
    )

}


export default RegistrationPage;
